description:
Passions explode when Xander discovers how much his stepsister, Yhivi, enjoys paying out losing bets with sexual favors. After a series of failed attempts at seducing her younger brother, Tyler, Aaliyah decides to really turn things up a notch. Willow's secret obsession with her stepbrother, Chad, comes to a head when he asks her to help him study for a class he's failing. Carmen succumbs to the &quot;casting couch&quot; when her stepbrother, Logan, volunteers to videotape her twerking audition and their hidden attraction can no longer be denied.

